"""**TRAIN AND TEST SPLIT**

Avant de faire un modèle de Machine Learning on doit d'abord faire un train and test split.

Petite explication de ChatGPT (oui encore)
C’est le fait de diviser ton dataset en deux parties :

Training set : pour entraîner ton modèle
Testing set : pour tester ton modèle (le mettre à l’épreuve)


Quand tu entraînes un modèle, tu veux qu’il apprenne des données, mais aussi que tu puisses vérifier s’il généralise bien sur des données qu’il n’a jamais vues.

Si tu entraînes et testes sur les mêmes données, ton modèle peut juste "tricher" (overfitting) et retenir les réponses au lieu de vraiment apprendre.



"""

X = df3.drop('churn',axis='columns')
y = df3['churn']

"""Donc ici on enlève la variable à prédire : Churn, en enlève la réponde ça sera à l'algorithme de la trouve.
Donc <br> : X = toutes les colonnes sauf "Churn" <br>
Y = 'churn' le résultat ciblé à prédire donc juste la colone 'churn
"""

from sklearn.model_selection import train_test_split #Fonction qui permet decouper le dataset en données d'entrainement de de test
X_train,X_test,y_train,y_test = train_test_split(X,y,test_size=0.2,random_state=5)

X_train.shape

"""La deuxième ligne dit :

Variable	Contenu : <br>
X_train	80% des features pour l’entraînement  (car on prend 20% pour le test) <br>
X_test	20% des features pour le test <br>
y_train	80% des labels (churn) associés à X_train <br>
y_test	20% des labels associés à X_test <br>
"""

X_train[:10] #Selectionnne les 10 premières lignes de mon dataframe = X_train DONC un échantillon de mes données d'entraînement

len(X_train.columns) # Rappel : Len = lenght donc renvoie le nombre d'elements (ex:carractères) d'un objet.

"""On a donc 26 colonnes car on a enlevé la colonne 'churn' rappellez vous."""

len(df3.columns)

"""Alors que sur notre précédente version de data frame 'df3' on avait 27 colonnes car on y avait pas encore supprimé la colonne 'churn'.

**3. Création d'un Réseau de neuronnes**
"""

import tensorflow as tf
from tensorflow import keras

model = keras.Sequential([
    keras.layers.Dense(20,input_shape=(26,),activation='relu'), #26 : Nombres de neurones / imput_shape=
    keras.layers.Dense(15,activation='relu'),
    keras.layers.Dense(1,activation='sigmoid')
])

model.compile( ### à creuser
    optimizer='adam',
    loss='binary_crossentropy',
    metrics=['accuracy']
)

#####Run le modèle

model.fit(X_train, y_train, epochs=5) #Epochs = correspond à un passage complet sur l'ensemble des données d'entraînement. Ici, le modèle passera 5 fois sur toutes les données pour ajuster ses poids et améliorer ses prédictions.

"""Ok on va expliquer ça parce que c'est balèze : <br> - keras.layers.dense ajoute une couche entièrement connectée (dense) avec 20 neurones, chaque neurones et connécré au neurone précédent. <br>
- input_shape=(26,) : Indique que chaque entrée de cette couche est un vecteur de 26 caractéristiques. Cette information est nécessaire uniquement pour la première couche afin que le modèle sache quelle est la forme des données d'entrée.
- activation='relu' : Spécifie que la fonction d'activation utilisée est la ReLU (Rectified Linear Unit). Cette fonction est définie comme relu(x) = max(0, x), ce qui introduit de la non-linéarité dans le modèle et aide à apprendre des relations complexes. <br> <br>

Ensuite pour la deuxième ligne : <br>

keras.layers.Dense(15, ...) : Ajoute une deuxième couche dense avec 15 neurones. Cette couche reçoit les 20 sorties de la couche précédente comme entrée.​ <br>

activation='relu' : Comme précédemment, utilise la fonction d'activation ReLU pour cette couche.


<br> Le modèle est composé de deux couches denses.​

La première couche a 20 neurones, reçoit des entrées de 26 caractéristiques et utilise la fonction d'activation ReLU.​

La deuxième couche a 15 neurones et utilise également la fonction d'activation ReLU.
<br>
<br>

Ensuite : <br>

1. Compilation du Modèle avec model.compile() <br>
Cette étape configure le modèle pour l'entraînement en spécifiant :​ <br> <br>

optimizer='adam' : L'optimiseur détermine comment le modèle ajuste ses poids pour minimiser la perte. L'optimiseur Adam (Adaptive Moment Estimation) est largement utilisé car il combine les avantages des optimisateurs AdaGrad et RMSProp, offrant une convergence rapide et efficace. ​ <br>

loss='binary_crossentropy' : La fonction de perte mesure l'écart entre les prédictions du modèle et les valeurs réelles. Pour les problèmes de classification binaire, comme prédire si un client va résilier ou non, la perte de cross-entropie binaire est appropriée. Elle évalue la distance entre deux distributions de probabilité : les prédictions du modèle et les étiquettes réelles. ​<br>

metrics=['accuracy'] : Les métriques évaluent les performances du modèle. L'exactitude (accuracy) calcule la proportion de prédictions correctes parmi l'ensemble des prédictions, fournissant une indication claire de la performance du modèle.
<br>
<br>

-------------------------------------------------------------------------------------------

Je vais essayer d'expliquer avec mes mots qu'est ce qu'un reseau de neuronne artificiel : <br>

Donc un réseau de neuronne artificielle est un ensemble de couche et surcouche de neurones, chacuns reliés aux précédents, ceux ci s'envoient entre eux les informations qu'ils ont reçu en imput afin de vectoriser une probabilité de réponse, cet ensemble de vecteur crée un modèle qui va orienté la décision du réseau de neuronne en fonction de la position l'ensemble des vecteurs.

**Structure d'un réseau de neurones artificiels** : <br>
Un réseau de neurones artificiels est composé de neurones organisés en couches :​ <br>

**Couche d'entrée** : Reçoit les données brutes (par exemple, les caractéristiques d'un client).​ <br>
**Couches cachées** : Traitent les informations reçues en appliquant des transformations pour extraire des caractéristiques pertinentes.​ <br>
**Couche de sortie** : Fournit le résultat final, comme la probabilité qu'un client résilie son contrat.

**Après execution on obtient des résultats d'environ 80% d'accuracy.**

On va tester avec 100 itérations :
"""

model.fit(X_train, y_train, epochs=100)

"""Pas mal, l'accuracy augmente avec le nombre d'itération ce qui signifie que le modèle est de plus en plus précis."""

model.fit(X_train, y_train)

"""Donc là avec une itération on a 82% d'accuracy, incroyable

**CONVERSION ET TRAITEMENT DES RESULTATS** <br> <br>
On aimerait maintenant convertir ces pourcentage en "OUI ou NON" le client se désabonne, par exemple quand on est au dessus de 50% on peut considérer que le client se désabonne
"""

yp = model.predict(X_test)
yp[:5]

y_test[:5]

"""Donc on va créer une fonction qui va convertir donc toute probabilité au dessus de 50% donc désabonnement OUI = 1 et sinon désabonnement = NON = 0 <br>

Ou alors c'est simplement une verification de si l'algo a vrai ou faux (je pense que c'est même plutôt ça), à vérifier.
"""

y_pred = []
for element in yp:
  if element > 0.3:
      y_pred.append(1)
  else:
      y_pred.append(0)


y_pred[:5]

"""OK NON JE VIENS DE CAPTER, 1 = Itération avec succès de + de 50% d'accuracy et 0 = - de 50% (oui c'est con mais je viens de réaliser)

**CLASSIFICATION REPORT**  <br> Mise en exergue des données.
"""

from sklearn.metrics import confusion_matrix , classification_report

print(classification_report(y_test,y_pred))

import seaborn as sn #Bibliothèque de visualisaion de donnée

cm = tf.math.confusion_matrix(labels=y_test,predictions=y_pred)

plt.figure(figsize = (10,7))
sn.heatmap(cm, annot=True, fmt='d')
plt.xlabel('Predicted')
plt.ylabel('Truth')

